import { Button, Flowbite } from 'flowbite-react';
import React from 'react';

const customTheme = {
    color: {
        black: '#0d1728',
        blackGray: '#11242e',
        blue: '#00B7FF',
        white: '#FFF',
    },
};


export default function CustomBtn() {
    return <Button theme={customTheme}>Click me</Button>;
}
